bioghist.p:
De Kamer oefent haar taak uit op de volgende manieren: 


door het bedrijfsleven bij de overheid (gemeenten, provincie en rijk) te vertegenwoordigen en voortdurend te wijzen op de belangen die voor het bedrijfsleven - en daarmee voor de werkgelegenheid - op het spel staan;


door het bedrijfsleven voor te lichten;


door bepaalde wetten die voor het bedrijfsleven van belang zijn, uit te voeren.

Een paar voorbeelden van overheidsactiviteiten waar de Kamer zich namens het bedrijfsleven mee bezighoudt en waarop zij zo nodig kritisch commentaar geeft en aangeeft hoe met de belangen van het bedrijfsleven rekening zou moeten worden gehouden: 


streek- en bestemmingsplannen;


stadsvernieuwingsgebieden;


verkeers- en vervoersvraagstukken (o.a. bereikbaarheid, parkeren);


totstandkoming nieuwe bedrijfsterreinen;


kantoorvestiging;


winkelcentra en markten (moeten ze komen en waar?);


milieuproblemen;


energieproblemen.

Naar het bedrijfsleven toe heeft de Kamer een duidelijk voorlichtende taak. Er is gespecialiseerde kennis in huis om het bedrijfsleven met feitelijke gegevens bij te staan. Bijvoorbeeld op het gebied van: 


economische wetgeving;


handelsadressen;


subsidieregeling;


invoerrechten;


exportdocumenten;


handelsbetrekkingen met het buitenland;


in voorbereiding zijnde gemeentelijke en provinciale maatregelen, bijvoorbeeld op het gebied van ruimtelijke ordening en milieu;


interne markt/Europa 1992 (Euro Info Centre).

De Kamer heeft door de wetgever een aantal taken toegewezen gekregen. De oudste en belangrijkste daarvan is de zorg voor het Handelsregister, de "burgerlijke stand van het bedrijfsleven", waarin niet alleen de namen en adressen van alle ondernemingen in haar gebied, maar ook bijvoorbeeld de bevoegdheden van directeuren en procuratiehouders, enz. te vinden zijn. Voorts heeft de Kamer de uitvoering van wetten op de volgende gebieden toegewezen gekregen: 


verenigingen- en stichtingenregister;


handelsnaamwet;


vestigingswet bedrijven;


vestigingswet detailhandel;


drank- en horecawet;


winkelsluitingswet;


wet autovervoer personen;


wet autovervoer goederen;


winkelweekacties;


makelaardij;


beëdiging van taxateurs;


afgifte van certificaten van oorsprong en andere documenten ten dienste van handel en nijverheid.

list.item:
verkeersproblemen:
constante zorg voor bereikbaarheid;
onvoldoende aandacht voor het belang van het verkeer voor het bedrijfsleven bij het Haagse Gemeentebestuur;
onvoldoende parkeervoorzieningen;
voor bedrijven hinderlijke maatregelen (bijvoorbeeld omrijden van vervoerders die in binnenstad moeten bezorgen - verkeersdrempels);
ontbreken van "Hoefijzer" rond Den Haag (Rijksweg 19, Verlengde Landscheidingsweg);

appraisal.p:
Het archief is bewerkt aan de hand van de "Lijst van voor vernietiging in aanmerking komende archiefbescheiden van de Kamers van Koophandel en Fabrieken in Nederland, 1979" (kenmerk MMA/Ar. 193.970, 12 februari 1979 en MH/PAZ 479/207, 23 maart 1979). Daarnaast is er bij de selectie rekening mee gehouden dat bescheiden over de volgende onderwerpen bewaard zijn gebleven: 


stukken betreffende karakteristieke regionale werken en gebouwen;


stukken betreffende plaatselijke verenigingen en vooraanstaande personen;


stukken betreffende onderwerpen die het eigen karakter van de regio belichten.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
